import React, { useState } from 'react'

function PrintContent() {
    const [subject, setSubject] = useState('');
    const [date, setDate] = useState('');
    const [msg, setMsg] = useState('');

    return(
        <div className='con-panal'>
            <div>
            <h3>{subject}</h3>
            <span>{date}</span>
            </div>
            <div>{msg}]</div>
        </div>
    )
}

export default PrintContent
